import axios from 'axios';
import { useState } from 'react';

const AllAccesses = () => {

  const [data, setData] = useState([]);
  const [pageNumber, setPageNumber] = useState(1);
  const [pageSize, setPageSize] = useState(50);
  const [sortPropertyName, setSortPropertyName] = useState(null);
  const [isSortByDescending, setIsSortByDescending] = useState(true);
  const [addressSearchField, setAddressSearchField] = useState(null);
  const [countSearchField, setCountSearchField] = useState(null);

  const fetchData = async () => {
    const requestBody = {
      pageNumber,
      pageSize,
      sortPropertyName,
      isSortByDescending,
      addressSearchField,
      countSearchField,
    };

    try {
      const response = await axios.post('https://localhost:44316/access/all-access', requestBody, {
        headers: {
          'Content-Type': 'application/json',
        },
      });
      setData(response.logs);
    } catch (error) {
      console.error('Error fetching data:', error);
      setData([]);
    }
  };

    return (
      <div>
        <h1>All Accesses</h1>
        <div>
            <div>
                <input
                type="text"
                placeholder="Address"
                value={addressSearchField}
                onChange={(e) => setAddressSearchField(e.target.value)}
                />
                <input
                type="number"
                placeholder="Count"
                value={countSearchField}
                onChange={(e) => setCountSearchField(Number(e.target.value))}
                />
                <button onClick={fetchData}>Search</button>
            </div>
            <div>
                <label>
                Page Size:
                <input
                    type="number"
                    value={pageSize}
                    onChange={(e) => setPageSize(Number(e.target.value))}
                />
                </label>
                <label>
                Page Number:
                <input
                    type="number"
                    value={pageNumber}
                    onChange={(e) => setPageNumber(Number(e.target.value))}
                />
                </label>
            </div>
            <ul>
                {Array.isArray(data) ? (
                data.map((item, index) => (
                    <li key={index}>{JSON.stringify(item)}</li>
                ))
                ) : (
                <li>No data available</li>
                )}
            </ul>
        </div>
      </div>
    );
  };
  


  export default AllAccesses;
